import RandomUser from './components/RandomUser/RandomUser';
import Wrapper from './components/UI/Wrapper/Wrapper';
import RandomUserContext from './store/randomuser-context';

const App = () => {
	return (
		<RandomUserContext.Provider>
			<Wrapper>
				<RandomUser />
			</Wrapper>
		</RandomUserContext.Provider>
	);
};

export default App;
